import React from 'react'

import { Progress } from 'react-sweet-progress';
import "react-sweet-progress/lib/style.css";

export default class SleepContainer extends React.Component {
  render() {
    return (
      <div>
        Sleep Data
        <Progress
          type="circle"
          percent={30}
        />
      </div>
    )
  }
}
